import React, { useState, useEffect } from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Container, Box } from '@mui/material';
import { StockChart } from './components/StockChart';
import { ErrorBoundary } from './components/ErrorBoundary';

// Sample data for testing
const sampleData = {
  'AAPL': [
    { timestamp: '2024-01-01T10:00:00Z', price: 150.25 },
    { timestamp: '2024-01-01T10:15:00Z', price: 151.30 },
    { timestamp: '2024-01-01T10:30:00Z', price: 149.80 },
  ],
  'GOOGL': [
    { timestamp: '2024-01-01T10:00:00Z', price: 2800.50 },
    { timestamp: '2024-01-01T10:15:00Z', price: 2805.75 },
    { timestamp: '2024-01-01T10:30:00Z', price: 2795.25 },
  ]
};

const theme = createTheme();

function App() {
  const [selectedStocks] = useState(['AAPL', 'GOOGL']);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <ErrorBoundary>
        <Container maxWidth="lg">
          <Box sx={{ py: 4 }}>
            <StockChart 
              data={sampleData}
              selectedStocks={selectedStocks}
              showAverage={true}
            />
          </Box>
        </Container>
      </ErrorBoundary>
    </ThemeProvider>
  );
}

export default App;
